using System;
using System.Threading.Tasks;
using System.Web.Mvc;
using ViaDoc.EntidadNegocios;
using ViaDoc.WebApp.Models;

namespace ViaDoc.WebApp.Controllers
{
    public class ValidacionController : Controller
    {
        // GET: Validacion
        public ActionResult Index()
        {
            return View();
        }

        public ActionResult IniciarSesion()
        {
            return View();
        }


        [HttpPost]
        [ValidateAntiForgeryToken]
        public async Task<ActionResult> ValidacionUsuario(string txtUsuario, string txtPassword)
        {
            string nombreUsuario = string.Empty;
            string usuarioLogin = string.Empty;
            int codigoRetorno = 0;
            string mensajeRetorno = string.Empty;
            Retorno respuesta = new Retorno();
            Utilitarios.Utilitarios utilitarios = new Utilitarios.Utilitarios();
            MetodosAdministracion metodosAdministrativo = new MetodosAdministracion();

            string contrasena = utilitarios.Convertir_MD5(txtPassword.Trim());

            await Task.Run(() => metodosAdministrativo.ValidarUsuario(txtUsuario, contrasena, ref nombreUsuario,
                                                ref usuarioLogin, ref codigoRetorno,
                                                ref mensajeRetorno));

            if (codigoRetorno.Equals(0))
            {
                respuesta.codigoRetorno = codigoRetorno;


                Session["nombreUsuario"] = nombreUsuario;
                Session["usuarioLogin"] = usuarioLogin;

                return RedirectToAction("Index", "Bienvenido");
            }
            else
            {
                respuesta.codigoRetorno = codigoRetorno;
                respuesta.mensajeRetorno = mensajeRetorno;

                ViewData["mensajeError"] = mensajeRetorno;

                return View("IniciarSesion");
            }
        }

        public ActionResult IngresoExitoso()
        {
            return View();
        }

        [HttpPost]
        public FileResult Download(string nombrePdf)
        {
            string ruta = "";

            byte[] newBytes = Convert.FromBase64String(ruta);
            var FileVirtual = "~/Descargas/" + nombrePdf;
            return File(newBytes, "application/pdf", "transferencia.pdf");
        }

        public ActionResult cerrarSesion()
        {
            Session["nombreUsuario"] = null;
            Session["usuarioLogin"] = null;

            return RedirectToAction("IniciarSesion", "Validacion");
        }
    }
}